import { StyleSheet } from 'aphrodite/no-important'
import { widthBlocks } from "../../variabels/dimensions"

export default StyleSheet.create({
  wrapper: {
    width: widthBlocks.rightBlock,
    margin: '10px 5px'
  },
  content: {
    padding: '6px 10px'
  },
  block: {
    padding: '4px 0'
  },
  title: {
    marginLeft: 10
  },
  text: {
    fontSize: 12
  },
  tickets: {
    marginLeft: 35
  }
})
